        <div className="w3-container">
    <img src="https://www.w3schools.com/w3css/img_avatar3.png" alt="Avatar" className="w3-right w3-circle" style={{width:'110px'}}/>
    <i class="fa fa-caret-down"></i>
    <h4 style={{marginTop : '1em',marginBottom: 0,fontSize: '1em'}} className="w3-text-gray"><b>Hello,</b></h4>
    <h4 style={{margin : 0,fontSize: '1em'}}><b>Sangeetha</b></h4>
    </div>
    </div> );
}

export default Dashboard;
